import React from "react";
import { Carousel } from "react-bootstrap";
import tuto from "../assets/tuto.jpg";
import forum from "../assets/forum.jpg";
import projet from "../assets/projet.jpg";
const MyCarousel = () => {
  return (
    <Carousel jus interval={1000}>
      <Carousel.Item>
        <img
          className="d-block w-50"
          src={forum}
          alt="First slide"
        />
        <Carousel.Caption>
          <h3>Première image</h3>
          <p>Description de la première image.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-50"
          src={projet}
          alt="Second slide"
        />
        <Carousel.Caption>
          <h3>Deuxième image</h3>
          <p>Description de la deuxième image.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-50"
          src={tuto}
          alt="Third slide"
        />
        <Carousel.Caption>
          <h3>Troisième image</h3>
          <p>Description de la troisième image.</p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
};

export default MyCarousel;
